import "./footer-scetion.css";
import React from 'react';
const FooterScetion = () => {
  return (
    <div className="copyright-and-information-abou-wrapper">
      <div className="copyright-and-information">
        @copyright and information about the TAKK
      </div>
    </div>
  );
};

export default FooterScetion;
